import React from 'react'

export const GifGrid = ({ category }) => {

  const getGifs = async() => {

    const resp = await fetch("http://api.giphy.com/v1/gifs/search?api_key=9arW6eCRyGoNPsWcpr6qEQhySBlUdcqu&q=rick&limit=10");
    const { data } = await resp.json();

    const gifs = data.map( img => {
      return {
        id: img.id,
        title: img.title,
        url: img.downsized_medium.ulr
      }
    } )

    console.log(gifs);

  }

  getGifs();

  return (
    <>
      <h3>{ category }</h3>
    </>
  )
}
